import LogoIcon from "./icons/logo";

function App(props) {
  return (
    <>
      <Header />
      {props.children}
      <Footer />
    </>
  );
}

function Header() {
  return (
    <header className="flex space-between">
      <LogoIcon />
      <div className="flex gap-1">
        <ul>
          <li></li>
          <li></li>
          <li></li>
        </ul>
      </div>
    </header>
  );
}

function Footer() {
  return <footer>Footer</footer>;
}

export default App;
